tent url='rtsp://v7.cache6.c.youtube.com/CkULENy73wIaPAkTg-VokNOiCRMYESARFEgGUgZ2aWRlb3NyIQH_7DJH7r-WxygxyBCLyrsMDvPB7EI6RNWvHdRsUJxg5gw=/0/0/0/video.3gp' type='video/3gpp' medium='video' expression='full' duration='301' yt:format='6'/><media:credit role='uploader' scheme='urn:youtube' yt:display='caddydave' yt:type='partner'>caddydave</media:credit><media:description type='plain'>This is the first post rebuild drive a Panther Tank. This tank was assembled in February of 1944. This tank fell through the ice and into a small river in Poland in January of 1945. It spent the next 45 years submerged. This rebuild started almost 6 years ago and is nearly complete. (some footage provided by Greg Taylor of Taylor Restorations and Pahrahdise Ranch. The Maybach engine in this tank is using the original block, crank shaft, connecting rods,connecting rod bearings, pistons, valves, camshafts , heads. The crankshaft mains were ground to remove the rust pits, new main bearing rollers were created to obtain the correct bearing clearance. This engine is using the original 6.8:1 compression ratio.. This vehicle is part of the collection of the Military Vehicle Technology Foundation. For more information check out www.milvehtechfound.com</media:description><media:keywords>Panther, tank, Tiger, Maybach, Sherman, WW2, WWII, world, war, two, german</media:keywords><media:license type='text/html' href='http://www.youtube.com/t/terms'>youtube</media:license><media:player url='http://www.youtube.com/watch?v=CaLTkGjlgxM&amp;feature=youtube_gdata_player'/><media:thumbnail url='http://i.ytimg.com/vi/CaLTkGjlgxM/default.jpg' height='90' width='120' time='00:02:30.500' yt:name='default'/><media:thumbnail url='http://i.ytimg.com/vi/CaLTkGjlgxM/mqdefault.jpg' height='180' width='320' yt:name='mqdefault'/><media:thumbnail url='http://i.ytimg.com/vi/CaLTkGjlgxM/hqdefault.jpg' height='360' width='480' yt:name='hqdefault'/><media:thumbnail url='http://i.ytimg.com/vi/CaLTkGjlgxM/1.jpg' height='90' wid